    "diag-note": {                                   "en": "We worked hard to create this project. As equivalent we expect from you some statistics about the usage.<br>No private information will be sent to ioBroker.org. Every time you press update adapter list the anonymized statistics will be sent.<br>Thank you!", "de": "Wir haben hart daran gearbeitet, dieses Projekt auf die Beine zu stellen. Als Gegenleistung bitten wir Sie, uns die Nutzungs-Statistik zu senden.<br>Es werden keine privaten Informationen zu ioBroker.org gesendet. Jedes Mal wenn die Adapterliste aktualisiert wird, wird auch die anonymisierte Statistik verschickt.<br>Vielen Dank!", "ru": "Мы долго работали над этим проектом. Мы просим вас переслать нам статистику использования, как компенсацию.<br>Никакой приватной информации не отсылается в ioBroker.org. Каждый раз, когда список драйверов обновляется, будет отсылаться анонимная статистика.<br>Большое спасибо!"},
